import { stat } from 'fs';
import { AuthProvider, AUTH_LOGIN } from 'react-admin';
const authProvider: AuthProvider = {
    login: async (auth: FormValues) => {
        if (AUTH_LOGIN) {
            const request = new Request('http://localhost:5000/login', {
                method: 'POST',
                body: JSON.stringify(auth),
                headers: new Headers({ 'Content-Type': 'application/json' }),
            });
            try {
                const response = await fetch(request);
                if (response.status < 200 || response.status >= 300) {
                    throw new Error(response.statusText);
                }
                const auth = await response.json();                
                console.log(auth);
                
                localStorage.setItem('auth', `${auth.accessToken}`);
                window.location.replace('/dashboard');
                Promise.resolve();
            } catch (error) {
                throw new Error('Network error');
            }
        }
        // accept all username/password combinations that is default code
        // localStorage.setItem('username', 'khag ');
        // return Promise.resolve();
    },
    logout: () => {
        localStorage.removeItem('auth');
        return Promise.resolve();
    },
    checkError: ({status}) => {
        if(status === 401 || status === 403){
            localStorage.removeItem('token');
            return Promise.reject();
        }
        return Promise.resolve()
    },
    checkAuth: () =>
        localStorage.getItem('auth') ? Promise.resolve() : Promise.reject(),
    getPermissions: () => Promise.reject('Unknown method'),
    getIdentity: () =>
        Promise.resolve({
            id: 'user',
            fullName: 'Khant Nyar',
            avatar:
                'data:image/jpeg;base64,',
        }),
};

export default authProvider;

interface FormValues {
    email?: string;
    walletAddress?: string;
}